script: |
  super -f text -I q7566.spq | sort > q7566.out

inputs:
  - name: q7566.spq
    data: |
      SELECT ALL - - col1 FROM tab2 (FORMAT parquet) WHERE NOT col0 >= col1 * 17 + - col0 + - 26 * - col1 * + col1 / 69 * col1;
  - name: tab2

outputs:
  - name: q7566.out
    data: |
      51
      67
      77
